MongoDb / C# filter and get all subdocuments<p>I'm having difficulties querying a Mongo-DB collection.</p>

<p>The document I'm using</p>

<pre><code>public class Customer
{
    public ObjectId Id { get; set; }

    public int CustomerId { get; set; }

    public List&lt;Address&gt; Addresses { get; set; }
}

public class Address
{
    public string Name { get; set; }
}
</code></pre>

<p>Some sample-Data</p>

<pre><code>{
    CustomerId: 2,
    Addresses: [
        {
            Name: "Daniel"
        },
        {
            Name: "Eric"
        },
        {
            Name: "Dan"
        }
        ]
}
</code></pre>

<p>I now want to query the documents by the CustomerId and filter some of the Addresses-values to return all Addresses with a Name like %Dan%. As the address-collection can be huge I want to already filter those addresses at query-time</p>

<pre><code>var mdb = mongoClient.GetDatabase("test");
var collection = mdb.GetCollection&lt;WebApi&gt;("Customer");
var builder = Builders&lt;Customer&gt;.Filter;
var searchTerm = "Dan";
</code></pre>

<p>When querying like that it works but it holds all addresses:</p>

<pre><code>var filter = builder.And(builder.Eq("InstallationId", 2),
                         builder.Regex("Addresses.Name", new BsonRegularExpression(".*" + searchTerm + ".*", "i")))
var result = collection.Find(filter).FirstOrDefault();
</code></pre>

<p>What I'd like to get is:</p>

<pre><code>[
    {
        Name: "Daniel"
    },
    {
        Name: "Dan"
    }
]
</code></pre>

<p>or</p>

<pre><code>{
    CustomerId: 2,
    Addresses: [
        {
            Name: "Daniel"
        },
        {
            Name: "Dan"
        }
        ]
}
</code></pre>

<p>I also tried several approaches with Aggregate/Match/Project but can't get it to work. "AsQueryable" also does not work as IndexOf is not implemented on the driver.</p>

<pre><code>collection.AsQueryable().Where(x =&gt; x.CustomId == 2).SelectMany(x =&gt;
                x.Addresses.Where(a =&gt; a.Name.IndexOf(searchTerm, StringComparison.InvariantCultureIgnoreCase) &gt;= 0).ToList();
</code></pre>

<p>Used Versions:</p>

<ul>
<li>MongoDB.Driver v 2.6.1 (also Bson)</li>
<li>.Net Framework 4.5.2</li>
</ul>

