Compare 2 count aggregations<p>I have a collection in MongoDB that looks something like the following:</p>

<pre><code>{ "_id" : 1, "type" : "start", userid: "101", placementid: 1 }
{ "_id" : 2, "type" : "start", userid: "101", placementid: 2 }
{ "_id" : 3, "type" : "start", userid: "101", placementid: 3 }
{ "_id" : 4, "type" : "end", userid: "101", placementid: 1 }
{ "_id" : 5, "type" : "end", userid: "101", placementid: 2 }
</code></pre>

<p>and I want to group results by <code>userid</code> then <code>placementid</code> and then count the types of "start" and "end", but only when the two counts are different. In this particular example I would want to get <code>placementid: 3</code> because when grouped and counted this is the only case where the counts don't match.</p>

<p>I've written a query that gets the 2 counts and the grouping but I can't do the filtering when counts don't match. This is my query:</p>

<pre><code>db.getCollection('mycollection').aggregate([
    {
        $project: {
            userid: 1,
            placementid: 1,
            isStart: { 
                $cond: [ { $eq: ["$type", "start"] }, 1, 0] 
            },
            isEnd: { 
                $cond: [ { $eq: ["$type", "end"] }, 1, 0] 
            }
        }
    },
    {
        $group: {
            _id: { userid:"$userid", placementid:"$placementid" }, 
            countStart:{ $sum: "$isStart" },
            countEnd: { $sum: "$isEnd" }
        }
    },
    {
        $match: {
            countStart: {$ne: "$countEnd"}
        }
    }
])
</code></pre>

<p>It seems like I'm using the match aggregation incorrectly because I'm seeing results where <code>countStart</code> and <code>countEnd</code> are the same.</p>

<pre><code>{ "_id" : {"userid" : "101", "placementid" : "1"}, "countStart" : 1.0, "countEnd" : 1.0 }
{ "_id" : {"userid" : "101", "placementid" : "2"}, "countStart" : 1.0, "countEnd" : 1.0 } 
{ "_id" : {"userid" : "101", "placementid" : "3"}, "countStart" : 1.0, "countEnd" : 0 } 
</code></pre>

<p>Can anybody point into the right direction please?</p>

