<p>And I created an API url to add new movie item into the <code>listMovie</code> array. Example code:</p>

<pre><code>movie = {
    'videoId': 3,
    'watchedTime': 155000,
    'status': False
}

self.userCollection.update_one({
    {'userId': user_id},
    {
        '$push': {
            'listMovie': movie
        }
